import './App.css';
import Test from './components/test.js';
import Button from '@mui/material/Button';

function main() {
  return (
    <div className="App">
      <header className="App-header">
        <Test items={["Hello", "bitch"]} />
        <Button variant="contained">Hello World</Button>
      </header>
    </div>
  );
}

export default main;
